import React, { Component } from 'react';
import './Main3content.css';


class Main3content extends Component {
  render() {
    return (
      <div className="main3content">
        <div id = "main3content">
          <h2 className="main3content__title">We will unlock people's potential to imagine and create new solutions to our greatest challenges</h2>

          <div className="main3content__text">
              <p>The UAE has a vision for the future based on radical creativity
              curiosity and generosity and invite the world's most curious minds and creative institutions to 
              co-create this future with us
              </p>
              <div className="main3content__text-underlined">
                <u>Creative thinkers from government, business, and culture will design the future together</u>
              </div>
              <p>AREA 2071 is a creative ecosystem to design the future that includes government, creative
                individuals, business, and people from all walks from life. We've come together to imagine
                and create solutions to the world's most pressing questions
              </p>
          </div>
        </div>
      </div>
    );
  }
}

export default Main3content;
